Isu Kulit Dan Kekurangan vitamin B3: Gejala kulit yang biasa terjadi termasuk ruam pada kawasan yang terdedah kepada cahaya matahari, seperti tangan, lengan, leher, dan muka. Ruam mungkin merah, bengkak, dan mempunyai rupa macam "sunburned"
